package com.seven.asimov.it.utils.logcat.wrappers;public class FirstTimePoliciesRetrievalWrapper extends LogEntryWrapper {    private long[] timestamps;        private long policyStorageVersion;    private long localPolicyHash;    private long serverPolicyHash;    public long[] getTimestamps() {        return timestamps;    }    public void setTimestamps(long[] timestamps) {        this.timestamps = timestamps;    }    public FirstTimePoliciesRetrievalWrapper() {        timestamps = new long[8];        setTimestamp(0);    }    public long getPolicyStorageVersion() {        return policyStorageVersion;    }    public void setPolicyStorageVersion(long policyStorageVersion) {        this.policyStorageVersion = policyStorageVersion;    }    public long getLocalPolicyHash() {        return localPolicyHash;    }    public void setLocalPolicyHash(long localPolicyHash) {        this.localPolicyHash = localPolicyHash;    }    public long getServerPolicyHash() {        return serverPolicyHash;    }    public void setServerPolicyHash(long serverPolicyHash) {        this.serverPolicyHash = serverPolicyHash;    }    @Override    public String toString() {        return "FirstTimePoliciesRetrievalWrapper{" +                "timestamps=" + timestamps +                ", policyStorageVersion=" + policyStorageVersion +                ", localPolicyHash=" + localPolicyHash +                ", serverPolicyHash=" + serverPolicyHash +                '}';    }}